webpackJsonp([0xe42b364df77a],{9109:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Cold rain",date:"08 Nov 2001",slug:"/2001-11-08-cold-rain/",tags:"Y2001"},html:'<p>Sometimes it pays to watch the nature shows on TV. In ARD is a film about a bird called <i>Eistaucher</i>, "ice diver"? Never heard of it, so I thought, but it turns out to be the <a href="http://www.khayward.com/loon.html">Common Loon</a> <i>Gavia immer</i>, filmed in northern Minnesota. I thought I recognized that sound. </p>\n<p>I\'m still here. Mama\'s out of town until Saturday, so I have both early and late shifts with Christopher, and time is short. How do single parents manage day in and day out? And we\'re in the middle of a particularly despressing cold and rainy spell.</p>\n<p>I did get my Perl programming problem sorted out yesterday, though.</p>'},next:{fields:{title:"Bark bark",date:"06 Nov 2001",slug:"/2001-11-06-bark-bark/"}},previous:{fields:{title:"Dump On Me",date:"10 Nov 2001",slug:"/2001-11-10-dump-on-me/"}}},{node:{fields:{title:"Bark bark",date:"06 Nov 2001",slug:"/2001-11-06-bark-bark/",tags:"Y2001"},html:'<p>I love programming for a living. You spend most of the day trying to solve riddles, only to find out that the answer was really obvious and that you were a real idiot not to see the answer right away.</p>\n<p>Then again, I read a while ago that people who are truly clueless <a href="http://www.apa.org/journals/psp/psp7761121.html">have no idea how clueless they are</a>. So as long I feel like an idiot, there\'s still hope.</p>'},next:{fields:{title:"Diamondbacks Win",date:"05 Nov 2001",slug:"/2001-11-05-diamondbacks-win/"}},previous:{fields:{title:"Cold rain",date:"08 Nov 2001",slug:"/2001-11-08-cold-rain/"}}},{node:{fields:{title:"Diamondbacks Win",date:"05 Nov 2001",slug:"/2001-11-05-diamondbacks-win/",tags:"Y2001"},html:"<p>Strange. I haven't watched a single inning of baseball this year. I haven't even seen a single pitch. Yet I found myself dreaming of the World Series last night. In my dream it was the Twins against Yankees. Impossible, I know, but it was still a good against evil thing.</p>\n<p>In my dream, the Yankees won.</p>"},next:{fields:{title:"They're Mad Now",date:"04 Nov 2001",slug:"/2001-11-04-theyre-mad-now/"}},previous:{fields:{title:"Bark bark",date:"06 Nov 2001",slug:"/2001-11-06-bark-bark/"}}}],pathPrefix:"",first:!1,last:!1,index:962,pageCount:1101}}}});
